import './LoginRegister.css'

export default class Login extends Component {
    constructor(props) {
        super(props)
    
        this.state = {
            
        }
    }
    
    render() {
        return (
            <React.Fragment>
                <label for='username'>Username</label>
                <input type='text' 
                id='username' 
                value={this.state.username}
                placeholder='CircleAfrica' 
                // onChange={handleChange}
                />

                <label for='password'>Password</label>
                <input type='text' 
                id='password' 
                placeholder='**********' 
                value={this.state.password}
                // onChange={handleChange}
                />

                <input type='submit' 
                value='submit' 
                className='submit' 
                // onClick={handleSubmitClick}
                />

                {/* <div className="alert alert-success" style={{display: this.state.successMessage ? 'block' : 'none' }} role="alert">
                    {this.state.successMessage}
                </div> */}
            </React.Fragment>
        )
    }
}
